### Algorithm ###
def floodfill(matrix, x, y):
    #"hidden" stop clause - not reinvoking for "c" or "b", only for "a".
    if matrix[x][y] == "a":
        matrix[x][y] = "c"
        #recursively invoke flood fill on all surrounding cells:
        if x > 0:
            floodfill(matrix,x-1,y)
        if x < len(matrix[y]) - 1:
            floodfill(matrix,x+1,y)
        if y > 0:
            floodfill(matrix,x,y-1)
        if y < len(matrix) - 1:
            floodfill(matrix,x,y+1)
def set_pixel(x, y, r, g, b, size):
	glColor3f(r, g, b)
	glPointSize(size)

	glBegin(GL_POINTS)
	glVertex2f(x, y)
	glEnd()
def color_pixel(width, height, x, y, size):
	rgb = glReadPixels(width / 2 + x , height / 2 + y, size ,size , 
						GL_RGB, GL_UNSIGNED_BYTE, None)
	return list(rgb)

def clearCanvas():
	glClearColor(0.0, 0.0, 0.0, 1.0)
	glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT)

def Traslate(vertices, tx, ty):

	T = [
		[1, 0, tx],
		[0, 1, ty],
		[0, 0, 1]
	]
	result = []
	for item in vertices:
		point = np.dot(T, item)
		result.append(point)
	return result
#Reflexion sobre eje X
def ReflectionX(vertices):
	R=[
		[1,0,0],
		[0,-1,0],
		[0,0,1]]
	result = []
	for item in vertices:
		point = np.dot(R, item)
		result.append(point)
	return result
#Reflexion sobre eje Y
def ReflectionY(vertices):
	R=[
		[-1,0,0],
		[0,1,0],
		[0,0,1]]
	result = []
	for item in vertices:
		point = np.dot(R, item)
		result.append(point)
	return result
def Rotation(vertices, angle):
	angle = math.radians(angle)
	R = [
		[math.cos(angle), -math.sin(angle), 0],
		[math.sin(angle), math.cos(angle), 0],
		[0, 0, 1]
	]
	result = []
	for item in vertices:
		point = np.dot(R, item)
		result.append(point)
	return result
def Scaled(vertices,sx,sy):
	R=[
		[sx,0,0],
		[0,sy,0],
		[0,0,1]
	]
	result = []
	for item in vertices:
		point = np.dot(R,item)
		result.append(point)
	return result

